import React from "react"

export default function Footers(){
    return(
        <footer>
            <span>
            <img src="./Facebook Icon.png"/>
            <img src="./GitHub Icon.png"/>
            <img src="./Instagram Icon.png"/>
            <img src="./Twitter Icon.png"/>
            </span>
        </footer>
    )
}
